import React, { Component } from 'react';
import Card from './Card'
import AddExercise from './AddExercise';

class ExerciseList extends Component {
    
    render(){
        return(
            <div className="center">
                {
                    exercises.map((excercise) => {
                        return(
                            <Card
                                key={excercise._id}
                                id={excercise._id}
                                {...excercise}
                            />
                        )
                    })
                }
                <AddExercise />
            </div>
        )
    }
}

export default ExerciseList
